define({"topics" : [{"title":"Picture Capturing tool","shortdesc":"\n                     <p class=\"shortdesc\">The <dfn class=\"term\">Picture Capturing</dfn> tool lets you instantly capture the screen images of     your test machines. \n                     </p>\n                  ","id":"Additional_feaures_image_capturing_tool","href":"TA_Help\/Topics\/Additional_features_image_capturing_tool.html","menu": {"hasChildren":false,},"tocID":"Additional_feaures_image_capturing_tool-d46e21743","next":"Additional_feaures_image_capturing_tool-d46e21743",},{"title":"Key Points Modification tool","shortdesc":"\n                     <p class=\"shortdesc\">The <dfn class=\"term\">Key Points Modification</dfn> tool applies a <dfn class=\"term\">keypoint detection</dfn> technique to detect matched objects between baseline images and a target   images.\n                     </p>\n                  ","id":"concept_ylx_yns_d4","href":"TA_Help\/Topics\/ug_Key_point_modify_tool.html","menu": {"hasChildren":false,},"tocID":"concept_ylx_yns_d4-d46e21779","next":"concept_ylx_yns_d4-d46e21779",},{"title":"Importing external image sources","shortdesc":"\n                     <p class=\"shortdesc\"><span class=\"ph\">TestArchitect</span> lets you easily import image files       (<span class=\"ph filepath\">.PNG</span>) format) as a new picture checks or additional new baseline images. \n                     </p>\n                  ","id":"concept_wbj_gym_wx","href":"TA_Help\/Topics\/ug_picture_checks_importing_images.html","menu": {"hasChildren":false,},"tocID":"concept_wbj_gym_wx-d46e21820","next":"concept_wbj_gym_wx-d46e21820",},{"title":"Exporting baseline images","shortdesc":"\n                     <p class=\"shortdesc\">Baseline images can be exported to image files (.<span class=\"ph filepath\">PNG</span> format),         which can be used as a backup or for re-importing.\n                     </p>\n                  ","id":"task_mm2_bsh_wx","href":"TA_Help\/Topics\/ug_picture_checks_exporting.html","menu": {"hasChildren":false,},"tocID":"task_mm2_bsh_wx-d46e21852","topics":[]},{"title":"Resolving unverified picture checks","shortdesc":"\n                     <p class=\"shortdesc\">Explains step-by-steps procedures to resolve unverified picture checks.</p>\n                  ","id":"task_dc3_dsc_2y","href":"TA_Help\/Topics\/ug_Resolving_unverfied_picture_checks.html","menu": {"hasChildren":false,},"tocID":"task_dc3_dsc_2y-d46e21866","topics":[]},{"title":"Configuring notification time period to resolve unverified picture checks ","shortdesc":"\n                     <p class=\"shortdesc\">By default, you will be notified every five days when you log into a repository which         has repository test results\n                        containing unverified picture checks.\n                     </p>\n                  ","id":"task_mkf_1kw_gy","href":"TA_Help\/Topics\/ug_configuring_notification_unverified_picture_checks.html","menu": {"hasChildren":false,},"tocID":"task_mkf_1kw_gy-d46e21877","topics":[]}]});